svg.script:

function show_a20c25ef(evt, text) {
	var pos = (evt.target.getAttribute("y") < 640) ? "bottom" : "top";
	var note = document.getElementById(pos + "_note_a20c25ef");
	note.textContent = text;
	note.setAttributeNS(null, "visibility", "visible");
	document.getElementById(pos + "_overlay_a20c25ef").setAttributeNS(null, "visibility", "visible");
}
function hide_a20c25ef(evt) {
	document.getElementById("top_note_a20c25ef").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("top_overlay_a20c25ef").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_note_a20c25ef").setAttributeNS(null, "visibility", "hidden");
	document.getElementById("bottom_overlay_a20c25ef").setAttributeNS(null, "visibility", "hidden");
}
